script:
reset();

const door = false;
const type = door ? 2 : 1;

const room = {
  x: -10,
  y: 0,
  z: -24,
};

box(
  room.x - 5, room.y, room.z - 5,
  30, 23, 30,
  2
);
box(
  room.x - 4, room.y, room.z - 4,
  28, 22, 28,
  (x, y, z) => (door ? 2 : (
    z >= room.z && z < room.z + 28
  	&& (x < room.x || x > room.x + 19) ? 1 : 3
  ))
);
box(
  room.x, room.y + 2, room.z,
  20, 18, 20,
  0
);
sphere(
  room.x + 4,
  room.y + 10,
  room.z + 9,
  8,
  0
);
sphere(
  room.x + 14,
  room.y + 10,
  room.z + 9,
  8,
  0
);
[
  [3, 3],
  [16, 3],
  [3, 16],
  [16, 16],

  [7, 7],
  [12, 7],
  [7, 12],
  [12, 12],
].forEach(([x, z]) => {
  box(room.x + x - 2, room.y + 19, room.z + z - 2, 5, 1, 5, type);
  box(room.x + x - 1, room.y + 19, room.z + z - 1, 3, 4, 3, 0);
});
box(room.x + 3, room.y + 4, room.z - 3, 14, 14, 2, type);
box(room.x + 4, room.y + 5, room.z - 2, 12, 12, 2, 0);

if (door) {
 box(room.x + 7, room.y + 5, room.z - 1, 6, 12, 1, 1);
}

for (let i = 0; i < 2; i += 1) {
  box(
    room.x + 3 + i * 10,
    room.y + 2,
    room.z + 11,
    4, 3, 1,
    type
  );
  box(
    room.x + 3 + i * 10,
    room.y + 2,
    room.z + 10,
    4, 1, 1,
    type
  );
}

const elevator = {
  x: -4,
  y: 0,
  z: -4,
};

box(
  elevator.x + 1, elevator.y + 1, elevator.z + 1,
  6, 7, 6,
  2
);
box(
  elevator.x + 2, elevator.y + 2, elevator.z + 2,
  4, 5, 4,
  0
);
box(
  elevator.x + 2, elevator.y + 2, elevator.z - 1,
  4, 5, 1,
  type
);
box(
  elevator.x + 3, elevator.y + 2, elevator.z - 1,
  2, 4, 3,
  0
);
